import './App.css';

import { Link } from 'react-router-dom';

class Home extends Component {

  render() {
    return (
<div>

      <div className="main">
        <div className="typewriter">
          Start your Oxbridge journey.
          <div>
            Find out how.
          </div>
        </div>
      </div>

</div>
    );
  }
}

export default Home;
